#include <stdio.h>
#include <string.h>
#include <unistd.h>
#include <fcntl.h>
#include "test.h"

int error_msg(const char *msg);

static int test_error_msg_output(const char *input)
{
	const char *tmp_path = "tmp_err.log";
	int saved_stderr = dup(STDERR_FILENO);
	int fd = open(tmp_path, O_CREAT | O_WRONLY | O_TRUNC, 0644);
	if (fd < 0)
		return (1);
	dup2(fd, STDERR_FILENO);
	error_msg(input);
	fflush(stderr);
	close(fd);
	dup2(saved_stderr, STDERR_FILENO);
	close(saved_stderr);

	// Lecture du fichier
	char buffer[1024] = {0};
	fd = open(tmp_path, O_RDONLY);
	if (fd < 0)
		return (1);
	read(fd, buffer, sizeof(buffer) - 1);
	close(fd);
	unlink(tmp_path); // Supprime le fichier

	// Ajout du \n attendu par error_msg
	char expected[1024];
	snprintf(expected, sizeof(expected), "%s\n", input);

	if (strcmp(buffer, expected) != 0)
	{
		printf(" > FAIL: error_msg(\"%s\") wrote \"%s\" (expected \"%s\")\n",
			input, buffer, expected);
		return (1);
	}
	return (0);
}

static int base_string(void)
{
	return test_error_msg_output("Erreur critique\n");
}

static int	empty_string(void)
{
	return test_error_msg_output("\n\n");
}

